import React from "react";

function Header() {
  return (
    <header>
      <h1>Bem-vindo à ONG!</h1>
      <nav>
        <ul>
          <li>Sobre Nós</li>
          <li>Projetos</li>
          <li>Como Ajudar</li>
          <li>Contato</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
